    true,nt"url": null,nt"notes": "Well data for the INEL-1 well located in
    eastern Snake River Plain, Idaho. This data collection includes caliper logs, lithology
    reports, borehole logs, temperature at depth data, neutron density and gamma data,
    full color logs, fracture analysis, photos, and rock strength parameters for the
    INEL-1 well.nnThis collection of data has been assembled as part of the site characterization
    data used to develop the conceptual geologic model for the Snake River Plain site
    in Idaho, as part of phase 1 of the Frontier Observatory for Research in Geothermal
    Energy (FORGE) initiative. They were assembled by the Snake River Geothermal Consortium
    (SRGC), a team of collaborators that includes members from national laboratories,
    universities, industry, and federal agencies, lead by the Idaho National Laboratory
    (INL).",nt"license_title": "Creative Commons Attribution",nt"extras":
